Delay 5 | item | times,reset | ok | item,reset
async function (inputs, outputs, adv) {
    const { state } = adv;
    const { item, times, reset } = inputs;
    const { ok } = outputs;

    if (typeof reset !== "undefined") {
      state.set("val", 0);
      return;
    }

    const curr = (state.get("val") || 0) + 1;
    state.set("val", curr);
    if (curr >= times) {
      adv.onError(new Error(`Limit of ${times} reached`));
    } else {
      ok.next(item);
      await new Promise((resolve) => setTimeout(resolve, 200));
    }
  }
